window.bookSummaryJSON = "<p>To become a king of the underworld at long last, William must resist an irresistible beauty - or a curse will ensure his end.... </p> <p><b>A merciless prince feared by all....</b></p> <p>Cursed by a vengeful witch, William of the Dark will die if he ever falls in love - murdered by the woman who steals his heart. His lone shot at redemption is a book filled with indecipherable code. Break the code, break the curse. Now, centuries later, heâ€™s condemned to a string of one-night stands...until he finds the only woman in the worlds able to set him free.</p> <p><b>A rare creature of myth and power....</b></p> <p>One of the last living unicorn shifters, Sunday \"Sunny\" Lane works from the shadows as a cryptanalyst, on the run from assassins and poachers. Then, the darkly seductive William abducts her, holding her captive in Hell. The closer they get, the more she hungers for his touch...and the stronger a mystical desire to kill him becomes....</p> <p>But which desire will prove stronger - lust or death? And who will give in first?</p>"; 
